import React, { useState } from "react";
import myVideo from '../components/homepagebgvd.mp4';
const Home = () => {
  const [isWindowVisible, setIsWindowVisible] = useState(false); // State to show/hide the small window
  const containerStyle = {
    position: "relative",
    width: "100vw",
    height: "100vh",
    overflow: "hidden",
    color: "#fff",
  };

  const videoStyle = {
    position: "absolute",
    top: 0,
    left: 0,
    width: "100%",
    height: "100%",
    objectFit: "cover",
    zIndex: -1,
  };
 
 

  // New overlay style to darken the background video
  const overlayStyle = {
    position: "absolute",
    top: 0,
    left: 0,
    width: "100%",
    height: "100%",
    backgroundColor: "rgba(12, 8, 8,0.80)", // Adjust the opacity (0.5 for moderate darkening)
    zIndex: 0,
  };

  const leftContentStyle = {
    position: "absolute",
    top: "30%",
    left: "10%",
    transform: "translateY(-50%)",
    textAlign: "left",
    maxWidth: "400px",
  };

  const headingStyle = {
    fontSize: "48px",
    marginTop: "250px",
    color: "#fff",
    maxWidth: "100%",
    lineHeight: "1",
    textAlign: "left",
    whiteSpace: "nowrap",
    textOverflow: "ellipsis",
  };

  const subHeadingStyle = {
    fontSize: "18px",
    lineHeight: "1.2",
    marginBottom: "20px",
    color: "#ddd",
    maxWidth:"100%",
    textAlign:"left",
    whiteSpace: "nowrap",
  };

  const buttonContainerStyle = {
    display: "flex",
    gap: "15px",
  };

  const buttonStyle = {
    padding: "15px 25px",
    fontSize: "16px",
    fontWeight: "bold",
    color: "#fff",
    backgroundColor: "#FB923C",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
    transition: "background-color 0.3s ease",
  };

  const buttonStyleAlt = {
    ...buttonStyle,
    backgroundColor: "transparent",
     border: "2px solid #FB923C",
    

  };

  
  const smallWindowStyle = {
    position: "absolute",
    top: "40%",
    left: "50%",
    transform: "translate(-50%, -50%)",
    backgroundColor: "gray",
    padding: "20px",
    borderRadius: "10px",
    textAlign: "center",
    color: "white",
    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.2)",
    zIndex: 30,
    width: "300px",
  };


  const outsideButtonStyle = {
    padding: "20px 40px",
    fontSize: "14px",
    fontWeight: "bold",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
    
  };
  return (
    <div style={containerStyle}>
      {/* Background Video */}
      <video
        style={videoStyle}
        src={myVideo}
        autoPlay
        loop
        muted
      />

      {/* Overlay to darken the video */}
      <div style={overlayStyle}></div>

      
            
        

      {/* Left Content */}
      <div style={leftContentStyle}>
  <h2 style={headingStyle}>
    Advocating for Financial<br /> 
    <span style={{color: "#FB923C",}}>Inclusive</span> and 
    <span style={{ color: "gr" }}> Borrower</span> 
    <br />Empowerment
   
  </h2>
  <p style={subHeadingStyle}>
    We're committed to creating a more equitable financial system where <br />everyone has access to fair lending practices and opportunities for <br />financial growth.
  </p>
  <div style={buttonContainerStyle}>
    <button style={buttonStyle} onClick={() => setIsWindowVisible(true)}>
      Get Started →
    </button>
    <button style={buttonStyleAlt} onClick={() => setIsWindowVisible(true)} >
      Learn More
      </button>
  </div>
</div>


 {isWindowVisible && (
        <>
          <div style={smallWindowStyle}>
            <h3>Welcome to AIFBF</h3>
            <p>
              Explore our features to empower borrowers<br /> 
              and achieve financial growth.<br />
              We're excited to have you here.
            </p>
          </div>
          {/* Buttons Below the Small Window */}
          <div style={{ textAlign: "center", marginTop: "-10px", position: "absolute", top: "60%", left: "50%", transform: "translateX(-50%)" }}>
            <button
              style={{ ...outsideButtonStyle, backgroundColor: "#007BFF", color: "#fff",marginRight: "10px" }}
              onClick={() => alert("Sign Up process started!")}
            >
              Sign Up<br></br> Now
            </button>
            <button
              style={{ ...outsideButtonStyle, color: "white",backgroundColor:"transparent",border: "2px solid #007BFF",}}
              onClick={() => setIsWindowVisible(false)}
            >
              Maybe<br></br> Later
            </button>
          </div>
        </>
 )}
      
    </div>
  );
}

export default Home;
